import React, { useState, useEffect, useContext } from "react";
import MainContainer from '../../components/layouts/MainContainer'
import {Button, Row, Col, Accordion, Form} from 'react-bootstrap'
import FilesContent from './FilesContent';
import CoursesAPI from "../../api/CoursesAPI";
import ClassesAPI from '../../api/ClassesAPI';
import FilesAPI from '../../api/FilesApi';
import { UserContext } from '../../context/UserContext';

export default function Files() {
  const [loading, setLoading] = useState(false)
  const [selectedFile, setSelectedFile] = useState('');
  const [selected, setSelected] = useState('');
  const [optionsDisplayed, setOptionsDisplayed] = useState([])
  const userContext = useContext(UserContext)
  const {user} = userContext.data

  const HandleSelected = (selectedType) => {
    setSelectedFile(selectedType);
    setSelected('')
    if(selectedType){
      if(selectedType === 'Class'){
        getClasses()
      }
      if(selectedType === 'Course'){
        getCourses();
      }
    }
  }
  const getCourses = async() => {
    setLoading(true)
    let response = await new CoursesAPI().getCourses()
    setLoading(false)
    if(response.ok){
      setOptionsDisplayed(response.data)
      console.log(response.data)
    }else{
      alert("Something went wrong while fetching all courses")
    }
  }
  
  // useEffect(() => {
  //   createCourseFile()
  // }, [])

  const createCourseFile = async() => {
    let data = {"base64String": "data:image/png;base64,", "fileName": "string"}
    // setLoading(true)
    let response = await new FilesAPI().newCourseFile(data)
    // setLoading(false)
    if(response.ok){
      // setOptionsDisplayed(response.data)
      console.log(response.data)
    }else{
      alert("Something went wrong while creating new file")
    }
  }

  const getClasses = async() => {
    console.log(user)
    setLoading(true)
    let response = await new ClassesAPI().getClasses(user?.teacher?.id)
    setLoading(false)
    if(response.ok){
      console.log(response.data)
      setOptionsDisplayed(response.data)
    }else{
      alert("Something went wrong while fetching all classes")
    }
  }

  return (
    <MainContainer loading={loading} activeHeader={'files'}>
        <Row className="row">
          <Col className="col-md-3 file-sidenav">
            <div style={{textAlign:'center', paddingBottom:'45px', paddingTop:'25px'}}><Button className="file-library" size='lg' variant="outline-warning"><i class="fas fa-folder"></i> File Library</Button></div>
          </Col>
          <Col className='mt-5 pt-4'>
            <Row>
              <Col>
                <Form.Select onChange={(e) => HandleSelected(e.target.value)}>
                  <option value=''>-- Select Here --</option>
                  <option value='Class'>Class</option>
                  <option value='Course'>Course</option>
                </Form.Select>
              </Col>
              <Col>
                <Form.Select className={selectedFile == 'Class' ? 'd-block' : 'd-none'} onChange={(e) => setSelected(e.target.value)}>
                  <option>-- Select {selectedFile} Here --</option>
                  {optionsDisplayed.map(item => {
                    return(
                      <option value={item.id}>{item.className}</option>
                    )
                  })}
                </Form.Select>
                <Form.Select onChange={(e) => setSelected(e.target.value)} className={selectedFile == 'Course' ? 'd-block' : 'd-none'}>
                  <option>-- Select {selectedFile} Here --</option>
                  {optionsDisplayed.map(item => {
                    return(
                      <option value={item.id}>{item.courseName}</option>
                    )
                  })}
                </Form.Select>
              </Col>
            </Row>
            <div className={selected ? 'd-block' : 'd-none'}>
              <FilesContent/>
            </div>
          </Col>
        </Row>
    </MainContainer>
  )
}
